import React from "react";
import styled from "styled-components";
import { colors } from "./../colors.js";

export const Note = (props) => {
  return (
    <StyledDiv>
      <span className={props.style}>{props.num}</span>
    </StyledDiv>
  );
};

Note.defaultProps = {
  num: 0,
  tag: "open",
};

const StyledDiv = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;

  height: 100%;
  width: 100%;
  overflow: hidden;
  color: ${colors.noteNormal};

  font-size: 1rem;

  .closed {
    text-decoration: line-through;
    color: ${colors.noteStrike};
  }
  .empty {
    visibility: hidden;
  }
  .open {
    font-weight: normal;
  }
  .accent {
    color: ${colors.noteAccent};
    font-weight: bold;
  }
`;
